import React, { useEffect } from "react";
import Card from "../components/Card";
import axios from "axios";


const Home = () => {

  useEffect(() => {
    const getData = async () => {
      let { data } = await axios("https://api.themoviedb.org/");
      setRes(data);
    };
    getData();
  }, []);


  return(
    <>
    <Card/>
    </>
  )
}

export default Home;
